import Post from "../post/Post";
import "./posts.css";

export default function Posts({ posts }) {
  return (
    <div className="posts">
     {/* {console.log(posts)} */}

    {posts.map((p) =>(
        <div key={p.id}>
            <Post/>
        </div>
    ))}
    </div>
  );
}
